import axios from "axios";
import React from "react";
import { useParams } from "react-router-dom";

const UserFinal = () => {
  const { id } = useParams();

  const [favorites, setFavorites] = React.useState({});

  React.useEffect(() => {
    axios
      .get(`/api/favorites/${id}`)
      .then((info) => info.data)
      .then((data) => {
        setFavorites(data);
      });
  }, []);

  return (
    <React.Fragment>
      {favorites?.map((fav, i) => {
        return <CardFavUsers key={i} movieID={fav} />;
      })}
    </React.Fragment>
  );
};
export default UserFinal;
